import { useLoaderData } from "react-router-dom";

export default function Detail() {
  const parkingLot = useLoaderData();
  console.log(parkingLot);
  return (
    <div>
      <h1>{parkingLot.title}</h1>
      <h4>{parkingLot.Address}</h4>
      <p>Spaces: {parkingLot.Spaces}</p>
    </div>
  );
}
